import React from 'react';

const RoomDetails = ({ roomId }) => {
  // Here you can fetch room details using roomId from an API or static data
  // For demonstration purposes, let's assume you have a hardcoded room object
  const room = {
    id: roomId,
    name: 'Example Room',
    description: 'This is an example room description.',
    image: 'https://example.com/room-image.jpg' // URL of the room image
  };

  return (
    <div>
      <h2>{room.name}</h2>
      <p>{room.description}</p>
      <img src={room.image} alt="Room" />
    </div>
  );
}

export default RoomDetails;
